import { biddingHistoryConstants } from "../constants";

const initialState = {
  biddingHistory: []
};
export function biddingHistory(state = initialState, action) {
  switch (action.type) {
    case biddingHistoryConstants.VIEW_BIDDING_HISTORY_REQUEST:
      return {
        ...state
      };
    case biddingHistoryConstants.VIEW_BIDDING_HISTORY_SUCCESS:
      return {
        ...state,
        biddingHistory: action.data.biddingHistory
      };
    case biddingHistoryConstants.VIEW_BIDDING_HISTORY_FAILURE:
      return {
        ...state
      };
    default:
      return {
        ...state
      };
  }
}
